import React from 'react';
import "./Works.css";
import Navbar from '../components/Navbar.jsx';
import Footer from '../components/Footer.jsx';

function Works(){
  return(
    <div>
      <Navbar/>
        <div className="container">
          <div className="container">
            <div className="row">
              <div className="col">
                <h5>
                  <a href="https://play.google.com/store/apps/details?id=tk.mbworks.www.karma">Karma</a>
                </h5>
              </div>
              <div className="col">
                <img className="image-fluid" src="../assets/my_photo.jpg" alt="karma_logo"/>
              </div>
            </div>
            <div className="row">
              <p>
                My own idea that should help to people to save their good
                and not good deeds and always be informed about the state of karma.
              </p>
            </div>
          </div>
        </div>
    <Footer/>
    </div>
  );
}

export default Works;
